window.bookSummaryJSON = "<p>I'm kicking myself for being so trusting, but that trust led me to a whole new realm - a world I never knew existed. </p> <p>Now that I know what I truly am, I must learn to control my powers so I can return to my life as a supernatural healer. Thankfully, I have an interesting, if unusual, instructor to help me along the way. </p> <p>But focusing on my lessons proves challenging when a certain werewolf refuses to give me up. </p> <p>Now, with Logan wanting to claim me while I'm struggling to learn how to exist in the supernatural community, my life grows increasingly chaotic. </p> <p>But that's nothing compared to what's coming. </p> <p>Little do I know, a threat looms over the entire community, and I'm destined to play a huge role in the war to come. </p> <p>Contains mature themes.</p>"; 
